        // chip-input form control
        this.autoCompleteChipList = new FormControl('');
        // mat-chip properties
        this.visible = true;
        this.selectable = true;
        this.removable = true;
        this.addOnBlur = true;
        this.isShowMoreVisible = false;
        this.disabled = false;
        // public filteredOptions: NgIterable<any>; //newcode
        this.chips = [];
        this.showChips = [];
        this.isInvalid = false;
        this.isError = false;
        this.errorMessage = '';
        this.isPasted = false;
        this.pasteText = '';
