    ngOnInit() {
        this.showDropdropdown(); // newcode
        this.controlSubscription = this.autoCompleteChipList.valueChanges.pipe(debounceTime(300)).subscribe((val) => {
            if (val) {
                this.updateDropdown(val);
            }
        });
    }
    ngOnChanges() {
        this.returnData(this.chips);
    }
    ngDoCheck() {
        this.returnData(this.chips);
    }
